import { doPostAsync } from "../api";
import authHeader from "../user/auth-header";

import {ip, tomcatPort} from "../../misc/constants";

const URL = `http://${ip}:${tomcatPort}/api/charger`;

/**
 * @author Magnus
 * @version 06/08/2021
 * Async method
 * Middleware-service for fetching users active session.
 * Error may indicate that user has no active session.
 * @return Promise
 */
const fetchSession = async () => {
    return new Promise((resolve, reject) =>
        doPostAsync(`${URL}/getCurrentChargerSession`, null, authHeader()).then(x => {
            resolve(x.data);
        }).catch((error) => {
            reject(error);
        }));

};

export { fetchSession };
